import React from "react";
import PropsTypes from "prop-types";

const AppLayout = ({ children }) => {
  return (
    <div>
      <h1>공통메뉴</h1>
      {children}
    </div>
  );
};

AppLayout.propType = {
  children: PropsTypes.node.isRequired,
};
export default AppLayout;
